import React from 'react';

import Logo from '../../Components/Header/Logo'
import Navigation from '../../Components/Header/Navigation'

export class Header extends React.PureComponent
{
    constructor(props)
    {
        super(props);
    }
    render()
    {
        return (
            <div>
                <Logo/>
                <Navigation/>
            </div>
        );
    }
}
